import "./App.css";
import Homepage from "./homepage.js";
import Browse from "./browse.js";
import Product from "./product.js";
import About from "./about.js";
import Faq from "./faq.js";
import Contact from "./contact.js";
import Cart from "./cart.js";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import React, { Component } from "react";

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      cartItems: [<Product id={0} />, <Product id={0} />],
    };
  }

  render() {
    return (
      <div id="App">
        {/* router to link my pages together */}
        <Router>
          <Switch>
            <Route
              exact
              path="/Products"
              cart={this.state.cartItems}
              component={Browse}
            />
            <Route
              exact
              path="/CouchPillow"
              cart={this.state.cartItems}
              component={() => <Product id={0} />}
            />
            <Route
              exact
              path="/BedPillow"
              cart={this.state.cartItems}
              component={() => <Product id={1} />}
            />
            <Route
              exact
              path="/RoundPillow"
              cart={this.state.cartItems}
              component={() => <Product id={2} />}
            />
            <Route
              exact
              path="/FloorPoufPillow"
              cart={this.state.cartItems}
              component={() => <Product id={3} />}
            />
            <Route
              exact
              path="/Cart"
              cart={this.state.cartItems}
              component={Cart}
            />
            <Route
              exact
              path="/About"
              cart={this.state.cartItems}
              component={About}
            />
            <Route
              exact
              path="/FAQs"
              cart={this.state.cartItems}
              component={Faq}
            />
            <Route
              exact
              path="/Contact"
              cart={this.state.cartItems}
              component={Contact}
            />
            <Route
              exact
              path="/"
              cart={this.state.cartItems}
              component={Homepage}
            />
          </Switch>
        </Router>
      </div>
    );
  }
}

export default App;
